import React, { useContext, useState } from "react";
import { ProgressContext } from "../context/ProgressContext";
import { ExternalLink, Video, FileText, Check } from "lucide-react";

const difficultyColors = {
  Easy: "text-green-400 bg-green-500/10 border-green-500/30",
  Medium: "text-yellow-400 bg-yellow-500/10 border-yellow-500/30",
  Hard: "text-red-400 bg-red-500/10 border-red-500/30",
};

const ProblemCard = ({ problem, topicId, index }) => {
  const { toggleProblem, isProblemCompleted } = useContext(ProgressContext);
  const [isChecking, setIsChecking] = useState(false);

  const isCompleted = isProblemCompleted(topicId, problem._id);

  const handleToggle = async () => {
    setIsChecking(true);
    await toggleProblem(topicId, problem._id);
    setIsChecking(false);
  };

  return (
    <div
      className={`glass-effect p-5 rounded-xl border transition-all duration-300 ${
        isCompleted ? "border-green-500/30 bg-green-500/5" : "border-white/10"
      } card-hover`}
    >
      <div className="flex items-start space-x-4">
        {/* Checkbox */}
        <button
          onClick={handleToggle}
          disabled={isChecking}
          className={`mt-1 w-6 h-6 rounded-md border-2 flex items-center justify-center transition-all duration-300 flex-shrink-0 ${
            isCompleted
              ? "bg-green-500 border-green-500"
              : "border-gray-600 hover:border-primary-500"
          } ${isChecking ? "opacity-50 cursor-not-allowed" : "cursor-pointer"}`}
        >
          {isCompleted && <Check className="w-4 h-4 text-white" />}
        </button>

        {/* Content */}
        <div className="flex-1 min-w-0">
          {/* Header */}
          <div className="flex items-start justify-between mb-2 flex-wrap gap-2">
            <h4
              className={`font-semibold text-gray-100 transition-all ${
                isCompleted ? "line-through text-gray-500" : ""
              }`}
            >
              {index + 1}. {problem.title}
            </h4>
            <span
              className={`px-3 py-1 rounded-full text-xs font-semibold border whitespace-nowrap ${
                difficultyColors[problem.difficulty]
              }`}
            >
              {problem.difficulty}
            </span>
          </div>

          {/* Description */}
          <p className="text-sm text-gray-400 mb-3 leading-relaxed">
            {problem.description}
          </p>

          {/* Tags */}
          {problem.tags && problem.tags.length > 0 && (
            <div className="flex flex-wrap gap-2 mb-3">
              {problem.tags.map((tag, idx) => (
                <span
                  key={idx}
                  className="px-2 py-1 bg-primary-500/10 text-primary-400 text-xs rounded-md border border-primary-500/30"
                >
                  {tag}
                </span>
              ))}
            </div>
          )}

          {/* Links */}
          <div className="flex flex-wrap gap-2">
            {/* YouTube Link */}
            <a
              href={
                problem.youtubeLink ||
                "https://www.youtube.com/watch?v=dQw4w9WgXcQ"
              }
              target="_blank"
              rel="noopener noreferrer"
              className="flex items-center space-x-1.5 px-3 py-1.5 bg-red-500/10 hover:bg-red-500/20 text-red-400 rounded-lg text-xs font-medium transition-all duration-300 border border-red-500/30 hover:scale-105"
            >
              <Video className="w-3.5 h-3.5" />
              <span>Tutorial</span>
              <ExternalLink className="w-3 h-3 opacity-60" />
            </a>

            {/* LeetCode Link */}
            <a
              href={problem.leetcodeLink || "https://leetcode.com/problemset/"}
              target="_blank"
              rel="noopener noreferrer"
              className="flex items-center space-x-1.5 px-3 py-1.5 bg-orange-500/10 hover:bg-orange-500/20 text-orange-400 rounded-lg text-xs font-medium transition-all duration-300 border border-orange-500/30 hover:scale-105"
            >
              <ExternalLink className="w-3.5 h-3.5" />
              <span>LeetCode</span>
            </a>

            {/* Article Link */}
            <a
              href={problem.articleLink || "https://www.geeksforgeeks.org/"}
              target="_blank"
              rel="noopener noreferrer"
              className="flex items-center space-x-1.5 px-3 py-1.5 bg-blue-500/10 hover:bg-blue-500/20 text-blue-400 rounded-lg text-xs font-medium transition-all duration-300 border border-blue-500/30 hover:scale-105"
            >
              <FileText className="w-3.5 h-3.5" />
              <span>Article</span>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProblemCard;
